using ShineEngine;

/// <summary>
/// 事务完成数据(generated by shine)
/// </summary>
public class WorkCompleteData:BaseData
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=BaseDataType.WorkComplete;
	
	/// <summary>
	/// 实例ID
	/// </summary>
	public long workInstanceID;
	
	/// <summary>
	/// 发起者索引(type+id)
	/// </summary>
	public int senderIndex;
	
	public WorkCompleteData()
	{
		_dataID=BaseDataType.WorkComplete;
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "WorkCompleteData";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		stream.startReadObj();
		
		this.workInstanceID=stream.readLong();
		
		this.senderIndex=stream.readInt();
		
		stream.endReadObj();
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		stream.startWriteObj();
		
		stream.writeLong(this.workInstanceID);
		
		stream.writeInt(this.senderIndex);
		
		stream.endWriteObj();
	}
	
	/// <summary>
	/// 读取字节流(简版)
	/// </summary>
	protected override void toReadBytesSimple(BytesReadStream stream)
	{
		this.workInstanceID=stream.readLong();
		
		this.senderIndex=stream.readInt();
		
	}
	
	/// <summary>
	/// 写入字节流(简版)
	/// </summary>
	protected override void toWriteBytesSimple(BytesWriteStream stream)
	{
		stream.writeLong(this.workInstanceID);
		
		stream.writeInt(this.senderIndex);
		
	}
	
	/// <summary>
	/// 复制(潜拷贝)
	/// </summary>
	protected override void toShadowCopy(BaseData data)
	{
		if(!(data is WorkCompleteData))
			return;
		
		WorkCompleteData mData=(WorkCompleteData)data;
		
		this.workInstanceID=mData.workInstanceID;
		this.senderIndex=mData.senderIndex;
	}
	
	/// <summary>
	/// 复制(深拷贝)
	/// </summary>
	protected override void toCopy(BaseData data)
	{
		if(!(data is WorkCompleteData))
			return;
		
		WorkCompleteData mData=(WorkCompleteData)data;
		
		this.workInstanceID=mData.workInstanceID;
		
		this.senderIndex=mData.senderIndex;
		
	}
	
	/// <summary>
	/// 是否数据一致
	/// </summary>
	protected override bool toDataEquals(BaseData data)
	{
		WorkCompleteData mData=(WorkCompleteData)data;
		if(this.workInstanceID!=mData.workInstanceID)
			return false;
		
		if(this.senderIndex!=mData.senderIndex)
			return false;
		
		return true;
	}
	
	/// <summary>
	/// 转文本输出
	/// </summary>
	protected override void toWriteDataString(DataWriter writer)
	{
		writer.writeTabs();
		writer.sb.Append("workInstanceID");
		writer.sb.Append(':');
		writer.sb.Append(this.workInstanceID);
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("senderIndex");
		writer.sb.Append(':');
		writer.sb.Append(this.senderIndex);
		
		writer.writeEnter();
	}
	
	/// <summary>
	/// 初始化初值
	/// </summary>
	public override void initDefault()
	{
		
	}
	
	/// <summary>
	/// 回池
	/// </summary>
	protected override void toRelease(DataPool pool)
	{
		this.workInstanceID=0L;
		this.senderIndex=0;
	}
	
}
